import React, { useState } from "react";
import { registerUser } from "../api/api";
import './App.css';

const Register = () => {
    const [formData, setFormData] = useState({
        firstName: "",
        lastName: "",
        email: "",
        image: "",
        cgpa: "",
        totalCredits: "",
        graduationYear: "",
        domainId: "", // Assuming domainId represents the chosen specialization ID
        specialization: "",
    });

    const [message, setMessage] = useState("");

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleImageChange = (e) => {
        setFormData({
            ...formData,
            image: e.target.files[0],
        });
    };

    const validateEmail = (email) => {
        const regex = /^\w+@[a-zA-Z_\.]+\.[a-zA-Z]{2,4}$/;
        return regex.test(email);
    };

    const validateCGPA = (cgpa) => {
        const number = parseFloat(cgpa);
        return number >= 2 && number <= 10;
    };

    const validateTotalCredits = (credits) => {
        const number = parseInt(credits, 10); // Parse to integer
        return number <= 250;
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        // Validation Logic
        let isValid = true;
        const errors = [];

        if (!validateEmail(formData.email)) {
            isValid = false;
            errors.push("Invalid email format");
        }

        if (!validateCGPA(formData.cgpa)) {
            isValid = false;
            errors.push("CGPA must be between 2 and 10");
        }

        if (!validateTotalCredits(formData.totalCredits)) {
            isValid = false;
            errors.push("Total credits cannot exceed 250");
        }

        if (!isValid) {
            setMessage(errors.join(", "));
            return; // Prevent form submission if validation fails
        }

        try {
            const response = await registerUser(formData);
            setMessage("Registration successful!");
        } catch (error) {
            setMessage("Error registering user.");
        }
    };

    const graduationYears = Array.from({ length: 11 }, (_, i) => 2020 + i); // Generate years 2020-2030
    const specializations = [
        { id: 1, name: "IML (Artificial Intelligence & Machine Learning)" },
        { id: 2, name: "TCS (Theoretical Computer Science)" },
        { id: 3, name: "SSY (Software Systems)" },
        { id: 4, name: "NC (Networking and Communication)" },
        { id: 5, name: "VLSI (VLSI Systems)" },
        { id: 6, name: "DT (Digital Society)" },
    ];

    return (
        <div className="register-form">
            <h2>Register</h2>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    name="firstName"
                    placeholder="First Name"
                    value={formData.firstName}
                    onChange={handleChange}
                    required
                />
                <input
                    type="text"
                    name="lastName"
                    placeholder="Last Name"
                    value={formData.lastName}
                    onChange={handleChange}
                    required
                />
                <input
                    type="email"
                    name="email"
                    placeholder="Email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                />
                <input
                    type="file"
                    name="image"
                    accept="image/*"
                    onChange={handleImageChange}
                />
                <input
                    type="number"
                    name="cgpa"
                    placeholder="CGPA"
                    step="0.01"
                    value={formData.cgpa}
                    onChange={handleChange}
                    required
                />
                <input
                    type="number"
                    name="totalCredits"
                    placeholder="Total Credits"
                    value={formData.totalCredits}
                    onChange={handleChange}
                    required
                />
                <input
                    type="number"
                    name="graduationYear"
                    placeholder="Graduation Year"
                    value={formData.graduationYear}
                    onChange={handleChange}
                    required
                />
                <select
                    name="specializationId"
                    value={formData.specializationId}
                    onChange={handleChange}
                    required
                >
                    <option value="">Select Specialization</option>
                    {specializations.map((specialization) => (
                        <option key={specialization.id} value={specialization.id}>
                            {specialization.name}
                        </option>
                    ))}
                </select>

                <button type="submit">Register</button>
            </form>
            {message && <p>{message}</p>}
        </div>
    );
};

export default Register;
